import { Link } from "react-router-dom";

const Admin = () => {
  return (
    <div className="h-[30px] w-full flex justify-between items-center px-16 bg-darkblue text-white">
      <div className="flex w-[350px] justify-evenly text-white">
        <p>File</p>
        <p>Edit</p>
        <p>View</p>
        <p>Bookmarks</p>
        <p>Go</p>
        <p>Tools</p>
        <p>Help</p>
      </div>
    </div>
  );
};

export default Admin;
